import React from "react";

const Search = (props) =>{
    return (
        <div className="col col-sm-2">
            <input 
                   className="form-control" 
                   placeholder="Movie name..." 
                   value={props.value}
                   onChange={()=>props.setSearchValue(event.target.value)}
            ></input>
        </div>
    )
}

export default Search;
